import { createUseStyles } from 'react-jss';
var useStyles = createUseStyles({
    Button: {
        appearance: 'none',
        // background: OpenColor.blue[5],
        border: 'none',
        padding: '5px 16px',
        borderRadius: 2.5,
    }
});
export default useStyles;
